-- ----------------------------
--  Table structure for `factility_address_log`
-- ----------------------------
DROP TABLE IF EXISTS `factility_address_log`;
CREATE TABLE `factility_address_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `fid` varchar(32) NOT NULL COMMENT '设备的id rc/device',
  `longitude` varchar(50) NOT NULL DEFAULT '' COMMENT '地理位置 经度信息',
  `latitude` varchar(50) NOT NULL DEFAULT '' COMMENT '地理位置 纬度信息',
  `created_ts` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `factility_cloud_setting`
-- ----------------------------
DROP TABLE IF EXISTS `factility_cloud_setting`;
CREATE TABLE `factility_cloud_setting` (
  `fid` varchar(32) NOT NULL COMMENT '设备的id rc/device',
  `type_category` tinyint(1) NOT NULL COMMENT '设备类型 1 device，2 rc',
  `is_find` tinyint(1) NOT NULL DEFAULT '0' COMMENT '设置是否开启找回 0 没有开启 1开启',
  `is_lose` tinyint(1) NOT NULL DEFAULT '0' COMMENT '设置是否开启丢失  0 没有开启 1 开启',
  `phone` varchar(13) DEFAULT '' COMMENT '丢失设备 通知的手机号码',
  `leave_messages` varchar(1000) DEFAULT '' COMMENT '丢失后留言信息',
  `created_ts` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  UNIQUE KEY `factility_cloud_setting_fid` (`fid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

