-- ----------------------------
--  Table structure for `file_info`
-- ----------------------------
DROP TABLE IF EXISTS `file_info`;
CREATE TABLE `file_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `account_id` bigint(18) NOT NULL COMMENT '授权帐号id',
  `file_name` varchar(128) NOT NULL COMMENT '文件名',
  `file_type` varchar(128) NOT NULL DEFAULT '' COMMENT '文件类型',
  `file_size` int(11) NOT NULL DEFAULT '0' COMMENT '文件大小',
  `add_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `hash_id` varchar(128) NOT NULL DEFAULT '' COMMENT '加密字符',
  `suffix` varchar(128) NOT NULL DEFAULT '' COMMENT '文件扩展名',
  `is_encrpt` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0 为不加密, 默认为0, 为0时将会直接返回可访问的文件地址',
  `extend_text` varchar(500) NOT NULL DEFAULT '' COMMENT '文件相关信息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=661 DEFAULT CHARSET=utf8 COMMENT='文件信息表';

