-- ----------------------------
--  Table structure for `file_name_csv`
-- ----------------------------
DROP TABLE IF EXISTS `file_name_csv`;
CREATE TABLE `file_name_csv` (
  `fid` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `bid` int(11) NOT NULL COMMENT '对应批次号id',
  `mid` varchar(32) NOT NULL COMMENT '厂商id',
  `org_name` varchar(128) NOT NULL COMMENT '原始文件名称',
  `c_name` varchar(128) NOT NULL COMMENT '文件名称',
  `status` smallint(1) NOT NULL DEFAULT '0' COMMENT '导入状态 0未导入 1 已导入 2导入失败（文件不存在）',
  `error_row` varchar(2000) DEFAULT '' COMMENT '导入文件时 记录错误的行数',
  `created_ts` int(11) DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`fid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `km_command`
-- ----------------------------
DROP TABLE IF EXISTS `km_command`;
CREATE TABLE `km_command` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `key` varchar(32) NOT NULL COMMENT 'Key（或者叫名字）',
  `code` varchar(4) NOT NULL COMMENT 'code',
  `version` varchar(4) DEFAULT NULL COMMENT 'VER（版本）',
  `analog_params` smallint(6) NOT NULL DEFAULT '0' COMMENT '模拟量参数个数',
  `can_map` varchar(45) NOT NULL DEFAULT '0' COMMENT '能否被map',
  `tag` varchar(128) DEFAULT NULL COMMENT 'Language Tag',
  `category_id` varchar(32) DEFAULT NULL COMMENT '存category_id。command命令能被那些device大类所使用。其中值0表示通用',
  `normal_params` smallint(6) NOT NULL DEFAULT '0' COMMENT '正常参数个数',
  `op_style` smallint(2) NOT NULL DEFAULT '0' COMMENT '0表示命令没有操作手，1表示有操作手',
  `canmap_once` smallint(2) NOT NULL DEFAULT '0' COMMENT '1代表一个命令在一条keymap中只能出现一次，0没有限制',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=116 DEFAULT CHARSET=utf8;

