  `id` varchar(32) NOT NULL COMMENT '主键',
  `key` varchar(32) NOT NULL COMMENT 'key值',
  `code` varchar(4) NOT NULL COMMENT 'code值',
  `parent` varchar(32) DEFAULT NULL COMMENT 'Key归属于哪个按键（例如：A_CLICK，A_DOUBLE_CLICK属于A键）',
  `type` varchar(32) DEFAULT NULL COMMENT '类型(例如：A_CLICK属于A键的一个动作，A键的类型就是PRESS_BUTTON；再例如：J0_PRESSD时J0的一个动作，JO的类型就是joystick)',
  `tag` varchar(128) DEFAULT NULL COMMENT 'Language Tag',
  `category` varchar(32) DEFAULT NULL COMMENT '目前只有event和status两个值。（即表示key值时属于event->一个事件，还是属于一个status->一个状态。pressed基本都属于状态。单机，双击，长按则都输属于事件）',
  `keytype` int(11) NOT NULL DEFAULT '0' COMMENT '0:event,1:key name,2:status,3:analog parameter',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

