-- ----------------------------
--  Table structure for `km_keymap`
-- ----------------------------
DROP TABLE IF EXISTS `km_keymap`;
CREATE TABLE `km_keymap` (
  `id` varchar(32) NOT NULL COMMENT '32位guid',
  `remote_type_id` varchar(32) NOT NULL COMMENT 'Remote type id',
  `category_id` varchar(32) NOT NULL COMMENT 'device category id',
  `device_type_id` varchar(32) DEFAULT NULL COMMENT 'Device type',
  `status` varchar(32) NOT NULL COMMENT '版本状态（bata版或者正式版）',
  `tag` varchar(128) DEFAULT NULL COMMENT 'Language Tag',
  `is_official` smallint(6) NOT NULL COMMENT '是否官方（0代表官方，1代表厂商，2代表用户）',
  `ver_big` smallint(6) NOT NULL COMMENT '版本最前一位',
  `ver_mid` smallint(6) NOT NULL COMMENT '版本中间一位',
  `ver_sml` smallint(6) NOT NULL COMMENT '版本最小一位',
  `add_time` timestamp NULL DEFAULT NULL COMMENT '添加时间',
  `release_time` timestamp NULL DEFAULT NULL COMMENT '发布时间',
  `keymap_name` varchar(255) NOT NULL COMMENT 'keymap的名称（用于描述keymap）',
  `km_keymapcol` varchar(45) DEFAULT NULL,
  `B_status` tinyint(2) DEFAULT '2' COMMENT 'bata版keymap的状态（1：通过；2：编写中；3：审核中；4：审核未通过）',
  PRIMARY KEY (`id`),
  KEY `key_status` (`status`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

