-- ----------------------------
--  Table structure for `sn_info_copy`
-- ----------------------------
DROP TABLE IF EXISTS `sn_info_copy`;
CREATE TABLE `sn_info_copy` (
  `sn_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `bid` varchar(50) NOT NULL COMMENT '所属父类 批次号 id',
  `type_category` smallint(1) NOT NULL DEFAULT '0',
  `sn` varchar(32) NOT NULL COMMENT '唯一的sn号',
  `check_status` smallint(1) NOT NULL DEFAULT '1' COMMENT '校验状态 1 校验中 2 可使用 3 废弃',
  `uuid` varchar(32) NOT NULL,
  `bind_time` int(11) NOT NULL DEFAULT '0' COMMENT '第一次用户绑定时间',
  `is_delete` smallint(1) NOT NULL DEFAULT '0' COMMENT '是否删除 0 可使用状态 1 删除状态',
  `rand_str` varchar(6) NOT NULL COMMENT '六位随机数 用于sn 绑定设备验证使用',
  `created_ts` int(11) DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`sn_id`),
  UNIQUE KEY `sn_info_sn` (`sn`) USING BTREE,
  FULLTEXT KEY `sn_info_bid` (`bid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
