DROP TABLE IF EXISTS `sn_manufacture_short_info`;
CREATE TABLE `sn_manufacture_short_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `mid` varchar(32) NOT NULL COMMENT '所属厂商id',
  `short` varchar(10) DEFAULT '' COMMENT '工厂缩写',
  `created_ts` int(11) DEFAULT '0' COMMENT '创建时间',
  `updated_ts` int(11) DEFAULT '0' COMMENT '修改时间',
  PRIMARY KEY (`id`),
  KEY `sn_manufacture_short_info_mid` (`mid`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

